import React from 'react';

const FilterToggles = (props) => {

    const handleCheck = (e) => {
        e.target.checked = true
    }


return(
    <div className= "">
        <input type="checkbox" id="scales" onClick= {(e)=> handleCheck(e)} name={props.trait.name} checked= {false}/> {props.trait.name}

    </div>
)
}
export default FilterToggles
